import React from 'react';

const peicecount = ({ videos }) => {
// console.log(videos);
const videosPieces = videos.map(video => { return video.PIECES});
console.log(videosPieces);
const reducer = (previousValue, currentValue) => previousValue + currentValue;

const numberOfPieces = (videosPieces.length != [])? videosPieces.reduce(reducer): 'one';


return (
  <p>Pieces: {String(numberOfPieces)}</p>
  );
};

export default peicecount;
